import React, { Component } from "react";
import {NavLink} from 'react-router-dom'


const link = {
    background: 'pink',
    width: '100px',
    margin: '6px 6px 6px 6px',
    color: 'blue'
}

class Navbar extends Component{

    constructor(){
        super()
    }

    showProfile = (event) => {
        this.props.history.push('/profile')
    }

    handleSubmit = (event) => {
        event.preventDefault()

        const postObj = {
            method: "POST",
            headers: {
                "Content-Type":""
            }
        }


        fetch("http://localhost:3000/users", postObj)
        .then( resp => resp.json() )
        .then( data => {
            console.log(data)
        })
    }

    render(){
        return(
        <div>
            <NavLink to='/' exact style={link}>
                Home
            </NavLink>

            <NavLink to='/murals' exact style={link}>
                Murals
            </NavLink>

            <NavLink to='/about' exact style={link}>
                About
            </NavLink>

            <NavLink to='/signup' exact style={link}>
                Signup
            </NavLink>

            <form>
                <label>Login</label>
                <input name='user_name' placeholder="username"/>
                <input name='password' type="password" placeholder="password"/>
                {/* <input type="submit" value="Submit" onClick={this.showProfile}/> */}
                <input type="submit" value="Submit" onClick={this.handleSubmit}/>
            </form>

        </div>
    )}
}

export default Navbar
